function Profile() {
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  //const user = await currentUser();
  //if (!user) return null;

  //const userInfo = await fetchUser(params.id);
  //if (!userInfo?.onboarded) redirect("/onboarding");

  return (
    <section>
      <ProfileHeader/>
      <Box sx={{ width: '100%'}} className="bg-gray-900">
      <Tabs value={value} className='text-white' onChange={handleChange} centered>
        <Tab label="Posts" sx={{color:'white'}}/>
        <Tab label="Item Two" sx={{color:'white'}} />
        <Tab label="Item Three" sx={{color:'white'}}/>
      </Tabs>
    </Box>
    </section>
  );
}
export default Profile;
